import styled from "styled-components";

export const Wrapper = styled.div `
	{	
        height: 100vh;
        width: 100vw;
		background-color: #3776ab;

	}
`;

export const Content = styled.div `
    display: flex;
    flex-direction: column;
    width: 100%;
    height: 100%;

`;


export const WelcomeMessage = styled.div `
	top: 0;
	left: 0;
	padding-top: 2em;
	padding-left: 2em;

	height: 5em;
	h2 {
		align-items: left;
		max-width: 12em;
		max-height: 2em;
		margin: 0;
	}
`;

export const NewBikePic = styled.div `
	flex:2;
	height: 5em;
`;

export const LoadAtHomePic = styled.div `
	flex:3;
	height: 5em;
`;


export const EnvironmentPic = styled.div `
	flex:4;
